import styled from "styled-components";

export const Menu = styled.nav`
  width: 100%;
  height: 50px;
  background-color: red;
  display: flex;
  justify-content: space-between;

  a {
    text-decoration: none;
  }
`;

export const MenuOption = styled.div`
  display: flex;
  justify-content: center;
`;
